import React from 'react';
import './App.css';
import NavBar from "./components/Navbar";
import Jumboo from "./components/Jumbotron";
import Container from 'react-bootstrap/Container';

function App() {
  return (
    <div 
    className="App"
    >
    <Container> 
    <NavBar>
     <Jumbo>

     </Jumbo>

    </NavBar>
    </Container>
    </div>
  );
}

export default App;
